import React from "react";
import Json from "./Json";
import {useState} from "react";

function UserData(){


}


function UserPage(){

    UserData();

    const handleCountyChange = event => {
        UserData.setcounty(event.target.value);
    };

    const handleDateChange = event => {
        UserData.setdate(event.target.value);
      };

    const handleTempChange = event => {
        UserData.setTemp(event.target.value);
      };

    const handleHumChange = event => {
        UserData.setHum(event.target.value);
      };

    const handle30Change = event => {
        UserData.setday30(event.target.value);
      };

    const handle60Change = event => {
        UserData.setday60(event.target.value);
      };
    const handle90Change = event => {
        UserData.setday90(event.target.value);
      };

    function handleSubmit(e){
        console.log("you click the button");
        console.log('county value is:', UserData.County);
        console.log('date value is:', UserData.datetime);
        console.log('temp value is:', UserData.temp);
        console.log('hum value is:', UserData.humidity);
        console.log('30 value is:', UserData.day30);
        console.log('60 value is:', UserData.day60);
        console.log('90 value is:', UserData.day90);
    }


    return (
        <div>
            <h1>Hi this is a wildfire prediction</h1>

            <label>County: </label>
            <input 
                type="text" 
                id ="County" 
                name ="County" 
                onChange={handleCountyChange}
                value={UserData.County}
                placeholder="Enter County">
            </input>
            <br></br>

            <label>Date: </label>
            <input 
                type="date" 
                name="datetime"
                onChange={handleDateChange}
                value={UserData.datetime}
            ></input>
            <br></br>

            <label>Temp: </label>
            <input 
                type="float" 
                name="temp" 
                onChange={handleTempChange}
                value={UserData.temp}
                placeholder="Enter Temp in Celius">
            </input>
            <br></br>

            <label>Hum: </label>
            <input 
                type="float" 
                name="Hum" 
                onChange={handleHumChange}
                value={UserData.humidity}
                placeholder="Enter Hum in %">
            </input>
            <br></br>

            <label>30-day avg prec: </label>
            <input 
                type="float" 
                name="30-day avg prec" 
                onChange={handle30Change}
                value={UserData.day30}
                placeholder="Enter 30-day avg precipitation in inches">
            </input>
            <br></br>

            <label>60-day avg prec: </label>
            <input 
                type="float" 
                name="60-day avg prec" 
                onChange={handle60Change}
                value={UserData.day60}
                placeholder="Enter 60-day avg precipitation in inches">
            </input>
            <br></br>

            <label>90-day avg prec: </label>
            <input 
                type="float" 
                name="90-day avg prec" 
                onChange={handle90Change}
                value={UserData.day90}
                placeholder="Enter 90-day avg precipitation in inches">
            </input>
            <br></br>

            <button type="button" name= "submit" onClick={handleSubmit}>Sumbit</button>
        </div>
    );
}

export default UserPage;
